script: |
  super -f text -I q11641.spq | sort > q11641.out

inputs:
  - name: q11641.spq
    data: |
      SELECT col2 + - col0 col1 FROM tab0 (FORMAT parquet) WHERE NOT - col0 NOT IN ( 88 - 19, col2, + + 97 * + col2 * - CAST ( - - 71 AS INTEGER ), col1 );
  - name: tab0

outputs:
  - name: q11641.out
    data: |
